import React, { useState, useEffect } from "react";
import "./styles/newTrade.css";

const NewTrade = ({ onAdd }) => {
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({
    symbol: "",
    optionType: "",
    strikePrice: "",
    expirationDate: "",
    entryPrice: "",
    exitPrice: "",
    contracts: "",
    openDate: "",
    closeDate: "",
    profitLoss: "",
  });

  useEffect(() => {
    // Any initialization code here
  }, []);

  const toggleModal = () => {
    setShowModal(!showModal);
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // const handleSubmit = async (e) => {
  //   e.preventDefault();
  //   try {
  //     console.log("Submitting payload:", formData);

  //     // Make API request to add the new trade
  //     const response = await fetch("http://localhost:8000/trades/", {
  //       method: "POST",
  //       headers: {
  //         "Content-Type": "application/json",
  //       },
  //       body: JSON.stringify(formData),
  //     });

  //     if (!response.ok) {
  //       throw new Error("Failed to add trade");
  //     }

  //     const data = await response.json();
  //     onAdd(data);

  //     // Reset the form data
  //     setFormData({
  //       symbol: "",
  //       optionType: "",
  //       strikePrice: "",
  //       expirationDate: "",
  //       entryPrice: "",
  //       exitPrice: "",
  //       contracts: "",
  //       openDate: "",
  //       closeDate: "",
  //       profitLoss: "",
  //     });

  //     // Close the modal after successful submission
  //     setShowModal(false);
  //   } catch (error) {
  //     console.error("Error adding trade:", error);
  //   }
  // };
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log("Submitting payload:", formData);

      // Convert numerical fields to numbers
      const data = {
        ...formData,
        strike_price: parseFloat(formData.strikePrice),
        entry_price: parseFloat(formData.entryPrice),
        exit_price: parseFloat(formData.exitPrice),
        contracts: parseInt(formData.contracts),
        profit_loss: parseFloat(formData.profitLoss),
      };

      // Remove closeDate if it's empty
      if (!formData.closeDate) {
        delete data.closeDate;
      }

      // Make API request to add the new trade
      const response = await fetch("http://localhost:8000/trades/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      });

      if (!response.ok) {
        throw new Error("Failed to add trade");
      }

      const responseData = await response.json();
      onAdd(responseData);

      // Reset the form data
      setFormData({
        symbol: "",
        option_type: "",
        strikePrice: "",
        expirationDate: "",
        entryPrice: "",
        exitPrice: "",
        contracts: "",
        openDate: "",
        closeDate: "",
        profitLoss: "",
      });

      // Close the modal after successful submission
      setShowModal(false);
    } catch (error) {
      console.error("Error adding trade:", error);
    }
  };

  return (
    <div className="new-trade">
      <div className="header-card" onClick={toggleModal}>
        <p>New</p>
        <i className="fa-solid fa-plus" id="new-btn"></i>
      </div>

      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setShowModal(false)}>
              &times;
            </span>
            <div className="card">
              <h1>Add New Trade</h1>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
                required
              />
              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="optionType"
                value={formData.option_type}
                onChange={handleChange}
                required
              />
              <label htmlFor="strikePrice">Strike Price:</label>
              <input
                type="text"
                name="strikePrice"
                value={formData.strike_price}
                onChange={handleChange}
                required
              />
              <label htmlFor="expirationDate">Expiration Date:</label>
              <input
                type="date"
                name="expirationDate"
                value={formData.expiration_date}
                onChange={handleChange}
                required
              />
              <label htmlFor="entryPrice">Entry Price:</label>
              <input
                type="text"
                name="entryPrice"
                value={formData.entry_price}
                onChange={handleChange}
                required
              />
              <label htmlFor="exitPrice">Exit Price:</label>
              <input
                type="text"
                name="exitPrice"
                value={formData.exit_price}
                onChange={handleChange}
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={formData.contracts}
                onChange={handleChange}
                required
              />
              <label htmlFor="openDate">Open Date:</label>
              <input
                type="date"
                name="openDate"
                value={formData.open_date}
                onChange={handleChange}
                required
              />
              <label htmlFor="closeDate">Close Date:</label>
              <input
                type="date"
                name="closeDate"
                value={formData.close_date}
                onChange={handleChange}
              />
              <label htmlFor="profitLoss">Profit Loss:</label>
              <input
                type="text"
                name="profitLoss"
                value={formData.profit_loss}
                onChange={handleChange}
              />
              <input type="submit" value="Add" />
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default NewTrade;
